const seed = async () => {
  try {
    await db.sync({ force: true });
    
    await Promise.all(
      campuses.map((campus) => {
        return Campus.create(campus);
      })
    );

    
    await Promise.all(
      students.map((student) => {
        return Student.create(student);
      })
    );
    
    console.log(green("Seeding worked!"));
    db.close();
  } catch (err) {
    console.error(red("Seeding failed... :("));
    console.error(err);
    db.close();
  }
};

